import React, { Component } from 'react';
import './Invitation.css'

class Invitation extends Component{

    // constructor(){
    //     super();
    // }

    render(){
        return(
            <div className="invitation">
                <div className="container">
                <h2>Invitation</h2>
                <div className="flex-between">
                    <div className="text-center">
                        <div className="img-card">
                            <img src="/images/bibin.jpg" alt="faceimg"/>
                        </div>
                        <h3>Bibin Joseph</h3>
                        <h5>(S/O Mrs. Bency & Mr. T J Joseph)</h5>
                    </div>
                    <div className="text-center">
                        <h2>Bibin & Emeliya</h2>
                        <h3>Are Getting Married on</h3>
                        <h3>26th Oct 2020 </h3>
                        <span>At St. Augustine's Church, Vettilappara, Malappuram.</span>
                    </div>
                    <div className="text-center">
                        <div className="img-card">
                            <img src="/images/bibin.jpg" alt="faceimg"/>
                        </div>
                        <h3>Bibin Joseph</h3>
                        <h5>(S/O Mrs. Bency & Mr. T J Joseph)</h5>
                    </div>

                </div>
                <div>We will take care of all the preventing measures of Covid 19 as prescribed by the Govt. Wear mask and Join us. Others, please join us through online.</div>
                </div>



            </div>
        )
    }
}

export default Invitation;
